import React from 'react';

const iframe_container = {
                left: 0,
                          width: "100%",
                          height: "700px !important",
                          position: "relative",
                          border: "0" 
                        }

const iframe ={top: 0,
      left: 0,
      width: "100%",
      height: "100%",
      position: "absolute",
      border: 'none'}

function TikTokEmbed() {
  return (
    <div className={iframe_container} style={{height: 700 + 'px', border: 'none'}}>
    <iframe
      src="https://www.tiktok.com/embed/7072819797184171310"
      className={iframe}
      allowfullscreen
      scrolling="no"
      width="700px"
      height="100%"
      border='none'
      allow="encrypted-media;"
    ></iframe>
  </div>
  );
}

export default TikTokEmbed;
